import React from 'react';
import Banner from './components/Banner';
import Exhibit from './components/Exhibit';
import './App.css'; // You can add your own CSS styling here

function App() {
  return (
    <div className="App">
      <Banner />
      <Exhibit title="Public IP">
        {/* Components related to displaying Public IP */}
      </Exhibit>
      <Exhibit title="Latency Metrics">
        {/* Components related to displaying Latency Metrics */}
      </Exhibit>
    </div>
  );
}

export default App;
